BEGIN TRANSACTION;
CREATE TABLE "matches" ("id" SERIAL PRIMARY KEY NOT NULL, "local_goals" integer, "away_goals" integer, "date" date, "time" time, "elimination" boolean, "golden_goal" boolean, "local_penalties" integer, "away_penalties" integer, "created_at" timestamp, "updated_at" timestamp, "local_user_id" integer, "away_user_id" integer, "local_team_id" integer, "away_team_id" integer, "finished" boolean, "league_id" integer);
CREATE TABLE "picks" ("id" SERIAL PRIMARY KEY NOT NULL, "user_id" integer, "number" integer, "created_at" timestamp, "updated_at" timestamp, "player_id" integer, "draft_id" integer);
CREATE TABLE "event_types" ("id" SERIAL PRIMARY KEY NOT NULL, "description" text);
CREATE TABLE "goal_types" ("id" SERIAL PRIMARY KEY NOT NULL, "description" text);
CREATE TABLE "events" ("id" SERIAL PRIMARY KEY NOT NULL, "player_id" integer, "match_id" integer, "event_type_id" integer, "goal_type_id" integer, "team_id" integer, "user_id" integer);
CREATE TABLE "trades" ("id" SERIAL PRIMARY KEY NOT NULL, "created_at" timestamp, "updated_at" timestamp, "status" text, "users" integer, "approvals" integer);
CREATE TABLE "player_movements" ("id" SERIAL PRIMARY KEY NOT NULL, "player_id" integer, "trade_id" integer, "created_at" timestamp, "updated_at" timestamp, "first_user_id" integer, "second_user_id" integer, "first_team_id" integer, "second_team_id" integer);
CREATE TABLE "trade_approvals" ("id" SERIAL PRIMARY KEY NOT NULL, "trade_id" integer, "user_id" integer, "approved" boolean, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "users" ("id" SERIAL PRIMARY KEY NOT NULL, "name" text, "created_at" timestamp, "updated_at" timestamp, "email" text, "gf" integer, "ga" integer, "wins" integer, "draws" integer, "loses" integer, "pts" integer, "dg" integer, "eff" float, "provider" text, "uid" text, "oauth_token" text, "oauth_expires_at" timestamp, "display_name" text, "elo" integer, "minutes" integer);
CREATE TABLE "teams" ("id" SERIAL PRIMARY KEY NOT NULL, "user_id" integer, "name" text, "country" boolean, "wins" integer, "loses" integer, "draws" integer, "gf" integer, "ga" integer, "created_at" timestamp, "updated_at" timestamp, "pts" integer, "dg" integer, "eff" float);
CREATE TABLE "releases" ("id" SERIAL PRIMARY KEY NOT NULL, "player_id" integer, "user_id" integer, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "leagues" ("id" SERIAL PRIMARY KEY NOT NULL, "name" text, "importance" integer, "round1_matches" integer, "created_at" timestamp, "updated_at" timestamp, "finished" boolean, "champion_id" integer);
CREATE TABLE "drafts" ("id" SERIAL PRIMARY KEY NOT NULL, "name" text, "users" integer, "rounds" integer, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "players" ("id" SERIAL PRIMARY KEY NOT NULL, "team_id" integer, "first_name" text, "last_name" text, "overall" integer, "primary_position" text, "secondary_position" text, "games_played" integer, "goals" integer, "assists" integer, "own_goals" integer, "yellow_cards" integer, "red_cards" integer, "created_at" timestamp, "updated_at" timestamp, "league" text, "on_the_block" boolean, "user_id" integer, "protected" boolean, "club" text, "age" integer, "height" text, "attack_WR" text, "defend_WR" text, "weak_foot" integer, "skill_moves" integer, "starting" boolean, "acceleration" integer, "sprint_speed" integer, "ball_control" integer, "dribbling_skill" integer, "agility" integer, "balance" integer, "curve" integer, "finishing" integer, "free_kick_accuracy" integer, "long_shots" integer, "penalties" integer, "shot_power" integer, "volleys" integer, "vision" integer, "crossing" integer, "long_passing" integer, "short_passing" integer, "heading_accuracy" integer, "jumping" integer, "strength" integer, "sliding_tackle" integer, "marking" integer, "standing_tackle" integer, "aggression" integer, "interceptions" integer, "diving" integer, "handling" integer, "kicking" integer, "positioning" integer, "reflexes" integer, "stamina" integer, "reactions" integer, "nation" text);
CREATE TABLE "wanted_players" ("id" SERIAL PRIMARY KEY NOT NULL, "player_id" integer, "user_id" integer);
CREATE TABLE "realTeams" ("id" SERIAL PRIMARY KEY NOT NULL, "name" text, "league" text, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "realPlayers" ("id" SERIAL PRIMARY KEY NOT NULL, "player_id" integer, "real_team_id" integer);
CREATE INDEX "index_matches_on_local_user_id" ON "matches" ("local_user_id");
CREATE INDEX "index_matches_on_away_user_id" ON "matches" ("away_user_id");
CREATE INDEX "index_matches_on_local_team_id" ON "matches" ("local_team_id");
CREATE INDEX "index_matches_on_away_team_id" ON "matches" ("away_team_id");
CREATE INDEX "index_picks_on_user_id" ON "picks" ("user_id");
CREATE INDEX "index_player_movements_on_player_id" ON "player_movements" ("player_id");
CREATE INDEX "index_player_movements_on_trade_id" ON "player_movements" ("trade_id");
CREATE INDEX "index_player_movements_on_first_user_id" ON "player_movements" ("first_user_id");
CREATE INDEX "index_player_movements_on_second_user_id" ON "player_movements" ("second_user_id");
CREATE INDEX "index_player_movements_on_first_team_id" ON "player_movements" ("first_team_id");
CREATE INDEX "index_player_movements_on_second_team_id" ON "player_movements" ("second_team_id");
CREATE INDEX "index_trade_approvals_on_trade_id" ON "trade_approvals" ("trade_id");
CREATE INDEX "index_trade_approvals_on_user_id" ON "trade_approvals" ("user_id");
CREATE INDEX "index_teams_on_user_id" ON "teams" ("user_id");
CREATE INDEX "index_releases_on_player_id" ON "releases" ("player_id");
CREATE INDEX "index_releases_on_user_id" ON "releases" ("user_id");
CREATE INDEX "index_players_on_team_id" ON "players" ("team_id");
COMMIT;
